package de.slg.ddnss.printertool.clients;

import static org.junit.jupiter.api.Assertions.assertEquals;

import org.apache.commons.codec.DecoderException;
import org.apache.commons.codec.binary.Hex;
import org.junit.jupiter.api.Test;

import de.slg.ddnss.printertool.util.Util;

class ByteCRC32 {

	String hex = "";

	@Test
	void testOddError() throws DecoderException {
		System.out.println(hex);
		String crc32Checksum = Util.calcChecksum(Hex.decodeHex(hex));
		assertEquals("320d9b9", crc32Checksum);
	}

	String goldenLast = "5a5aa5a5"
			+ "0000026d"
			+ "00000b7e"
			+ "66d6707b"
			     + "";
	String last = "";
	@Test
	void testLastPackage() throws DecoderException {
		String crc32Checksum = Util.calcChecksum(Hex.decodeHex(last));
		assertEquals("66d6707b", crc32Checksum);
	}
	
	String box_gold = "5a5aa5a50000004a00000"
			+ "828"
			+ "";
	String box_last = "5a5aa5a50000004a00000"
			+ "b7e"
			+ "";
	@Test
	void testBoxLastPackage() throws DecoderException {
		String crc32Checksum = Util.calcChecksum(Hex.decodeHex(box_last));
		assertEquals("4d7ad8c9", crc32Checksum);
	}
}
